import React from "react";
import s from "./Dialog.module.css"
import {NavLink} from "react-router-dom";

const DialogItem = (props) => {
    let path = "/dialog/" + props.id;
    return (
        <NavLink to={path} activeClassName={s.active} className={s.dialog}>
            <p>{props.name}</p>
        </NavLink>
    );
}

const Message = (props) => {
    return <div className={s.dialog}>{props.message}</div>
}

const Dialog = () => {
    let dialogUsers =[
        {name:'Igor', id:'1'},
        {name:'Artem', id:'2'},
        {name:'Sasha', id:'3'},
        {name:'Pasha', id:'4'},
        {name:'Yana', id:'5'}
    ]
    let dialogMessage =[
        {name:'Hello', id:'1'},
        {name:'How are you?', id:'2'},
        {name:'You are shit!', id:'3'}
    ]
    return (
        <div className={s.dialogs}>
            <div className={s.dialogsItem}>
                <DialogItem name={dialogUsers[0].name} id={dialogUsers[0].id}/>
                <DialogItem name={dialogUsers[1].name} id={dialogUsers[1].id}/>
                <DialogItem name={dialogUsers[2].name} id={dialogUsers[2].id}/>
                <DialogItem name={dialogUsers[3].name} id={dialogUsers[3].id}/>
                <DialogItem name={dialogUsers[4].name} id={dialogUsers[4].id}/>
            </div>
            <div className={s.messages}>
                <Message message="Hello"/>
                <Message message="How are you?"/>
                <Message message="You are shit!"/>
            </div>
        </div>
    );
}
export default Dialog
